import React, { Component } from 'react';
import dynamic from 'next/dynamic';
// import Welcome from '../components/welcome';
// import CowsayPage from '../components/cowsay';
// import WithLess from '../components/withless';
// import NextHead from '../components/nexthead';
// import RoutePage from '../components/route';
const Welcome = dynamic(import('../components/welcome'))
const WelcomeWithLoading = dynamic(import('../components/welcome'),{
  loading:() => <p>...</p>
})
const OtherModules = dynamic({
  modules: () => {
    const components = {
      CowsayPage: import('../components/cowsay'),
      WithLess: import('../components/withless'),
      NextHead: import('../components/nexthead'),
      RoutePage: import('../components/route')
    }
    return components
  }
})
//Index
class Index extends Component {
    constructor(props) {
      super(props)
      this.state = {}
    }
    render() {
      return (
        <div>
           <Welcome />
           <WelcomeWithLoading />
           <OtherModules />
           {/* <CowsayPage />
           <WithLess />
           <NextHead />
           <RoutePage /> */}
        </div>
      )
    }
  }
  
  export default Index
